var script = document.currentScript;
var id = script.getAttribute('data-id');
var container = document.getElementById(id);
if (container.getAttribute('data-initialized') != '1') {
	container.setAttribute('data-initialized', '1');
	var title1 = '<img class="wp-embed-header-desktop" src="data:image/svg+xml;base64," alt="Il Sondaggio dei Sondaggi">';
	title1 += '<img class="wp-embed-header-mobile" src="data:image/svg+xml;base64," alt="Il Sondaggio dei Sondaggi">';
	var configs = [{
		'title': title1,
		'titleText': 'Eurosondaggio<br>e Quiz dei Partiti',
		'elements': [
			{
				'data-code': "5kisX",
				'data-type': "dw"
			}, {
				'data-code': "17806441",
				'data-type': "fl"
			}, {
				'data-code': "",
				'data-type': "eu"
			}
		]
	}, {
		'title': title1,
		'titleText': 'Eurosondaggio',
		'elements': [
			{
				'data-code': "5kisX",
				'data-type': "dw"
			}, {
				'data-code': "2WHNc/1/",
				'data-type': "dw"
			}
		]
	}, {
		'title': title1,
		'titleText': 'Il Quiz dei Partiti',
		'subtitle': 'Disponibile in oltre 20 lingue, EU&I è uno strumento online che invita gli utenti a reagire a 30 dichiarazioni che coprono una vasta gamma di questioni rilevanti nella politica europea. I risultati mostrano quali partiti sono più vicini alle loro preferenze, sia nel loro paese che in tutta Europa.',
		'elements': [
			{
				'data-code': "",
				'data-type': "eu"
			}
		]
	}];
	var images = {
		"wh": "",
		"eunews": "",
		"ae": ""
	};
	var config = container.getAttribute('data-config');
	var data = configs[(config - 1) || 0];
	if (container.getAttribute('data-json')) {
		var d = JSON.parse(container.getAttribute('data-json'));
		if (d) {
			for (var key in d) {
				data[key] = d[key];
			}
		}
	}
	//	console.log('data', data);
	var style = document.createElement("style");
	style.type = 'text/css';
	var css = '.wh-embed-header h2{margin-bottom: 2rem;position:relative;color:#fff;text-transform: uppercase;font-weight:bold;font-size:clamp(1rem, 3.3vw, 5rem);line-height: 1.1;font-family: system-ui;}';
	css += '.wh-embed-header h2>div{position:absolute;top:21.8%;left:50%;width:42%;height:35%;display:flex;justify-content:center;align-items:center;transform:translateX(-50%);text-align:center;} .wh-embed-header img{width: 100%;}img.wp-embed-header-mobile{display:none}';
	css += '.wh-embed-header h3{font-family: system-ui;font-weight:500;}';
	css += '.wh-embed-footer,.wh-embed-element-footer{background: #eee;display:flex;flex-wrap:wrap;gap:2rem;justify-content:space-between;padding:3rem 0;position: relative;}';
	css += '.wh-embed-footer>*{flex:0 0 calc((100% - 2rem) / 2);text-align:center}.wh-embed-footer>div{flex:0 0 100%;}.wh-embed-footer>*:nth-child(2){text-align:left;}.wh-embed-footer>*:last-child{text-align:right;}.wh-embed-footer img{max-width:100%;}';
	css += '.wh-embed-footer::before,.wh-embed-footer::after{background: #eee;position: absolute;height: 100%;width:calc((100vw - 100% - 18px) / 2);top:0;left:100%;content:\'\';}.wh-embed-footer::after{left:auto;right:100%;}';
	css += '.wh-embed-element{margin-bottom:2rem}.wh-embed-element-footer{background: transparent;border-top: 1px solid #000;padding: 1rem 0;}';
	css += '@media only screen and (max-width: 767.98px){.wh-embed-header h2{font-size:clamp(1.4rem, 6.3vw, 5rem);}.wh-embed-header h2>div{top: 33%;width: calc(100% - 2rem);height: 23%;} img.wp-embed-header-desktop{display:none}img.wp-embed-header-mobile{display:inline}.wh-embed-footer>*:first-child,.wh-embed-footer>*:last-child{text-align:center;}}';
	css += '@media only screen and (max-width: 600.98px){.wh-embed-footer{gap:1rem;padding:2rem 1rem;}.wh-embed-footer>*{flex:0 0 100%;}}';
	if (style.styleSheet) {
		// This is required for IE8 and below.
		style.styleSheet.cssText = css;
	} else {
		style.appendChild(document.createTextNode(css));
	}
	container.appendChild(style);

	var header = document.createElement("div");
	header.setAttribute("class", "wh-embed-header");
	container.appendChild(header);

	if (data.title) {
		var title = document.createElement("h2");
		title.innerHTML = data.title;
		header.appendChild(title);

		if (data.titleText) {
			var titleText = document.createElement("div");
			titleText.innerHTML = data.titleText;
			title.appendChild(titleText);
		}
	}
	if (data.subtitle) {
		var subtitle = document.createElement("h3");
		subtitle.innerHTML = data.subtitle;
		header.appendChild(subtitle);
	}
	if (data.text) {
		var text = document.createElement("p");
		text.innerHTML = data.text;
		header.appendChild(text);
	}

	var body = document.createElement("div");
	body.setAttribute("class", "wh-embed-body");
	container.appendChild(body);

	var footer = document.createElement("div");
	footer.setAttribute("class", "wh-embed-footer");
	container.appendChild(footer);

	var whdisclaimer = document.createElement("div");
	whdisclaimer.innerHTML = '<p style="font-size: 16px; font-weight: normal;margin:0;text-align:left;">In collaborazione con</p>';
	footer.appendChild(whdisclaimer);

	var whlink = document.createElement("a");
	whlink.setAttribute("href", "https://www.eunews.it/");
	whlink.setAttribute("target", "_blank");
	footer.appendChild(whlink);
	var whimg = document.createElement("img");
	whimg.src = "data:image/svg+xml;base64," + images['eunews'];
	whlink.appendChild(whimg);

	whlink = document.createElement("a");
	whlink.setAttribute("href", "https://www.eunews.it/2024/04/24/vuoi-un-altro-punto-di-vista-indipendente-su-tutto-cio-che-accade-in-europa-leggi-il-bollettino-quotidiano-europe-di-agence-europe/");
	whlink.setAttribute("target", "_blank");
	footer.appendChild(whlink);
	whimg = document.createElement("img");
	whimg.src = "data:image/svg+xml;base64," + images['ae'];
	whlink.appendChild(whimg);

	if (data.elements && data.elements.length) {
		data.elements.forEach(function(config) {
			var ediv = document.createElement("div");
			ediv.setAttribute('class', 'wh-embed-element');
			ediv.setAttribute('data-json', JSON.stringify(config));
			for (var key in config) {
				if (key != 'logo') {
					ediv.setAttribute(key, config[key]);
				}
			}
			body.appendChild(ediv);
		});
	}

	var elements = body.getElementsByClassName('wh-embed-element');

	function getFooter(config) {
		var div = document.createElement("div");
		div.className = "wh-embed-element-footer";
		var a = document.createElement("a");
		a.href = "https://www.withub.it/";
		a.target = "_blank";
		var logo = document.createElement("img");
		logo.src = "data:image/svg+xml;base64," + images['wh'];
		a.appendChild(logo);
		div.appendChild(a);

		if (config && config.logo) {
			a = document.createElement("a");
			a.href = config.logo.href;
			a.target = "_blank";
			logo = document.createElement("img");
			logo.src = "data:image/svg+xml;base64," + images[config.logo.id];
			a.appendChild(logo);
			div.appendChild(a);
		}

		return div;
	}

	var i = 0;
	while (i < elements.length) {
		var el = elements[i];
		var code = el.getAttribute("data-code");
		var type = el.getAttribute("data-type");
		var elconfig = JSON.parse(el.getAttribute('data-json'));
		if (type == "dw") {
			var ocontainer = document.createElement("div");
			var dwobj = document.createElement("iframe");
			dwobj.setAttribute('style', "width: 0; min-width: 100% !important; border: none");
			dwobj.setAttribute('src', "https://datawrapper.dwcdn.net/" + code);
			ocontainer.appendChild(dwobj);
			el.appendChild(ocontainer);
			el.appendChild(getFooter(elconfig));
			var dwscript = document.createElement("script");
			dwscript.textContent = '!function(){"use strict";window.addEventListener("message",(function(a){if(void 0!==a.data["datawrapper-height"]){var e=document.querySelectorAll("iframe");for(var t in a.data["datawrapper-height"])for(var r=0;r<e.length;r++)if(e[r].contentWindow===a.source){var i=(a.data["datawrapper-height"][t] + 48)+"px";e[r].style.height=i}}}))}();';
			el.appendChild(dwscript);
		} else if (type == "eu") {
			var euobj = document.createElement("iframe");
			euobj.setAttribute('style', "width: 0; min-width: 100% !important; border: none; min-height: 90vh");
			euobj.setAttribute('src', "https://euandi.eu/it/survey/european-elections/statements.html?country_id=16");
			el.appendChild(euobj);
			el.appendChild(getFooter(elconfig));
		} else if (type == "fl") {
			var flobj = document.createElement("div");
			flobj.setAttribute("class", "flourish-embed flourish-chart");
			flobj.setAttribute("data-src", "visualisation/" + code);
			var flscript = document.createElement("script");
			flscript.src = "https://public.flourish.studio/resources/embed.js";
			flobj.appendChild(flscript);
			el.appendChild(flobj);
			el.appendChild(getFooter(elconfig));
			//<div class="flourish-embed flourish-chart" data-src="visualisation/17410453"><script src="https://public.flourish.studio/resourcesdwscriptbj.js"></script></div>
		}
		++i;
	}
}
